const NavLinks = (props) => {
    return ( 
        <ul className="navigation-list">

          <li className="nav-item" onClick={() => props.isMobile && props.closeMobileMenue()}>
            <a href="#news">NEWS</a>
          </li>
          <li className="nav-item" onClick={() => props.isMobile && props.closeMobileMenue()}>
            <a href="#about">ABOUT</a>
          </li>
          <li className="nav-item" onClick={() => props.isMobile && props.closeMobileMenue()}>
            <a href="#music">MUSIC</a>
          </li>

        </ul>
     );
}

export default NavLinks;
